import React, { Component } from 'react';

//COMPONENTS
import Header from './components/headerComponent/header';
import Homepage from 
'./components/pages/homePage';

//CSS SHEET
import './assets/css/style.css';

class App extends Component {
  render() {
    return (
        
        <div id = "appContainer">
        
            <Header/>
                
                <Homepage/>
        
        
        
        </div>
        
    );
  }
}

export default App;
